import React, { useState } from 'react';

const Register = ({ onNavigate }) => {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [submitting, setSubmitting] = useState(false);

  const submit = (e) => {
    e.preventDefault();
    setSubmitting(true);
    // small demo delay to show animation
    setTimeout(() => {
      setSubmitting(false);
      onNavigate('home');
    }, 900);
  };

  return (
    <div className="min-h-screen flex items-center justify-center px-6 py-12">
      <div className="relative max-w-6xl w-full grid grid-cols-1 lg:grid-cols-2 gap-8 items-center">

        {/* Left hero: colorful, animated */}
        <div className="rounded-3xl p-12 overflow-hidden relative bg-gradient-to-br from-pink-500 via-purple-600 to-indigo-600 text-white shadow-2xl">
          <div className="absolute -left-24 -top-16 w-72 h-72 bg-white/10 rounded-full blur-3xl animate-pulse" />
          <div className="absolute -right-12 -bottom-12 w-56 h-56 bg-white/8 rounded-full blur-2xl" />

          <h1 className="text-5xl font-extrabold mb-4 leading-tight">Join EmotionLab</h1>
          <p className="text-lg opacity-90 mb-8">Create an account to track emotions, get personalized suggestions, and explore the dashboard â€” fast, private, and playful.</p>

          <div className="space-y-4 mt-6">
            <div className="flex items-center gap-3">
              <div className="w-12 h-12 rounded-lg bg-white/20 flex items-center justify-center">ðŸŽ¯</div>
              <div>
                <h4 className="font-semibold">Real-time detection</h4>
                <p className="text-sm opacity-80">Fast & lightweight</p>
              </div>
            </div>

            <div className="flex items-center gap-3">
              <div className="w-12 h-12 rounded-lg bg-white/20 flex items-center justify-center">ðŸ”’</div>
              <div>
                <h4 className="font-semibold">Privacy first</h4>
                <p className="text-sm opacity-80">Frames stay local or on your consented server</p>
              </div>
            </div>
          </div>
        </div>

        {/* Right form: big, animated fields */}
        <div className="bg-white/5 backdrop-blur-sm p-10 rounded-2xl shadow-xl border">
          <h2 className="text-3xl font-bold mb-6">Create your account</h2>

          <form onSubmit={submit} className="space-y-6">
            <div className="relative">
              <label className="block text-sm font-medium mb-2">Full name</label>
              <input
                value={name}
                onChange={e => setName(e.target.value)}
                placeholder="Your full name"
                className="w-full p-4 rounded-xl border border-white/10 bg-transparent focus:outline-none focus:ring-4 focus:ring-purple-300 transition"
                required
              />
            </div>

            <div className="relative">
              <label className="block text-sm font-medium mb-2">Email address</label>
              <input
                value={email}
                onChange={e => setEmail(e.target.value)}
                placeholder="you@domain.com"
                type="email"
                className="w-full p-4 rounded-xl border border-white/10 bg-transparent focus:outline-none focus:ring-4 focus:ring-indigo-300 transition"
                required
              />
            </div>

            <div className="relative">
              <label className="block text-sm font-medium mb-2">Password</label>
              <input
                value={password}
                onChange={e => setPassword(e.target.value)}
                placeholder="Create a secure password"
                type="password"
                className="w-full p-4 rounded-xl border border-white/10 bg-transparent focus:outline-none focus:ring-4 focus:ring-pink-300 transition"
                required
              />
            </div>

            <div className="flex items-center gap-4">
              <button
                type="submit"
                disabled={submitting}
                className="flex items-center gap-3 px-6 py-3 rounded-xl bg-gradient-to-r from-purple-500 via-pink-500 to-indigo-500 text-white font-semibold shadow-lg transform transition hover:-translate-y-1 disabled:opacity-60"
              >
                {submitting ? (
                  <svg className="w-5 h-5 animate-spin" viewBox="0 0 24 24">
                    <circle className="opacity-25" cx="12" cy="12" r="10" stroke="currentColor" strokeWidth="4" fill="none" />
                    <path className="opacity-75" fill="currentColor" d="M4 12a8 8 0 018-8v8z" />
                  </svg>
                ) : 'Create account'}
              </button>

              <button
                type="button"
                onClick={() => onNavigate('login')}
                className="px-5 py-3 rounded-xl border border-white/10 bg-transparent hover:bg-white/5 transition"
              >
                Already have an account
              </button>
            </div>

            <p className="text-sm opacity-80">By creating an account you agree to our <span className="underline">Terms</span> and <span className="underline">Privacy</span>.</p>
          </form>
        </div>
      </div>
    </div>
  );
};

export default Register;
